import React from 'react';

function DepartmentDetail() {
  // Define custom colors as inline styles
  const colors = {
    gray900: '#1a1a1a',
    gray800: '#2a2a2a',
    gray600: '#4a4a4a',
    textPrimary: '#f0f0f0',
    textTertiary: '#b0b0b0',
  };

  return (
    <div style={{ backgroundColor: colors.gray900, color: colors.textPrimary }} className="flex min-h-screen py-[3vw] justify-center font-serif">
      <div className="w-full max-w-[1500px] mx-auto">
        <div style={{ backgroundColor: colors.gray800 }} className="min-h-[80vh] w-[98%] max-w-[1600px] p-[2vw_4vw_6vw] flex flex-col">
          <div className="grid grid-cols-[minmax(min-content,175px)_minmax(max-content,1fr)_minmax(max-content,400px)]">
            <div style={{ borderBottomColor: colors.gray600 }} className="flex items-center pb-2 pt-0.5 border-b-2 md:border-b-0">
              <div className="flex items-center justify-center w-[100px] h-[100px]">
                {/* Logo content */}
              </div>
              <div className="flex flex-col ml-3 leading-5">
                <span style={{ color: colors.textPrimary }}>Logo Title 1</span>
                <span style={{ color: colors.textTertiary }}>Logo Title 2</span>
              </div>
            </div>
            {/* More header content */}
          </div>
          {/* More app content */}
        </div>
      </div>
    </div>
  );
}

export default DepartmentDetail;
